import React, { Component } from 'react';
import './TrackList.css';

class TrackList extends Component {
  render() {
    return (
      <div className="TrackList">
      {
        this.props.searchResults.map(result => {
          return <Track result={result} />
        })
      }
      </div>
);
}
}

export default TrackList;
